import React, { useState } from 'react';
import { Container, Typography, TextField, Button, Box } from '@mui.material';
import axios from 'axios';

function FeeCalculatorPage() {
  const [salePrice, setSalePrice] = useState('');
  const [marketplace, setMarketplace] = useState('');
  const [fee, setFee] = useState(null);
  const [error, setError] = useState(null);

  const handleCalculateFee = async () => {
    try {
      const response = await axios.post('/api/calculate_fee', {
        sale_price: parseFloat(salePrice),
        marketplace: marketplace,
      });
      setFee(response.data.fee);
      setError(null);
    } catch (err) {
      setError(err.response.data.error);
      setFee(null);
    }
  };

  return (
    <Container maxWidth="lg" sx={{ mt: 4 }}>
      <Typography variant="h3" gutterBottom>
        Fee Calculator
      </Typography>
      <Box sx={{ display: 'flex', flexDirection: 'column', gap: 2 }}>
        <TextField
          label="Sale Price"
          variant="outlined"
          value={salePrice}
          onChange={(e) => setSalePrice(e.target.value)}
        />
        <TextField
          label="Marketplace"
          variant="outlined"
          value={marketplace}
          onChange={(e) => setMarketplace(e.target.value)}
        />
        <Button variant="contained" color="primary" onClick={handleCalculateFee}>
          Calculate Fee
        </Button>
        {fee !== null && (
          <Typography variant="h6">
            The fee for selling on {marketplace} is ${fee.toFixed(2)}
          </Typography>
        )}
        {error && (
          <Typography variant="h6" color="error">
            {error}
          </Typography>
        )}
      </Box>
    </Container>
  );
}

export default FeeCalculatorPage;
